import React from "react";

const SkeletonLoad = () => {
  return (
    <div className="skeleton-wrapper">
      <div className="skeletonData">
        <Skeleton type="title" />
        <Skeleton type="text" />
        <Skeleton type="thumbnail" />
        <Skeleton type="avatar" />
      </div>
    </div>
  );
};

export default SkeletonLoad;
